@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'desarrollo para angular';
}


<mat-toolbar>

  <span>desarrollo para angular</span>
  <span class="example-spacer"></span>
  <mat-divider></mat-divider>
